import React from "react";
import UsersList from "../components/users-list/UsersList";

const Users = () => {
    const USERS = [
      {
        id: "u1",
        name: "Ash Yas",
        image: "https://wallpaperaccess.com/full/4184338.jpg",
        places: 3,
      },
      {
        id: "u2",
        name: "Asher Yasia",
        image: "https://images.unsplash.com/photo-1609109238958-eb5130c99873?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8M3x8YmVhdXRpZnVsJTIwcGxhY2VzfGVufDB8fDB8fA%3D%3D&w=1000&q=80",
        places: 2,
      },
    ];

    return (
        <UsersList items={USERS} />
    );
};

export default Users;
